import React from 'react';
//import DirectorCard from './DirectorCard';

function DirectorsPage({ directors, movies }) {

    const getDirectors = directors.map((director) => {
        return <div>
                    <DirectorCard 
                    id={director.id}
                    name={director.name}
                    movies={director.movies}
                    directors={directors}
                    />
               </div>
    })
    return (
        <div>
            Directors
            {getDirectors}
        </div>
    )
}

export default DirectorsPage;
